import React from 'react';
import { useState, useEffect } from 'react';
import $ from 'jquery';
import PlanCard from './util/PlanCard';

function Plans() {
    const [plans, setPlans] = useState([]);
    useEffect(() => {
        $("#view-plans-btn").click(() => {
            $('html, body').animate({
                scrollTop: $(".plans").offset().top - 50
            }, 1);
        });

        const tempPlans = [
            {
                name: 'Free',
                amount: 0,
                contains: [
                    {
                        name: 'Exam Limit',
                        value: 2
                    },
                    {
                        name: 'User Limit',
                        value: 0
                    },
                    {
                        name: 'User Limit',
                        value: 0
                    }
                ]
            }
        ];
        setPlans(tempPlans);

    }, []);
  return (
      <div className='plans'>
        <h1>Administrator Plans</h1>
        <div className='plan-row'>
            {
                plans.map((d, key) => {
                    return <PlanCard 
                        name='Free'
                        amount='0'
                        contains={['Create 2 exams', 'Create 2 section per exam', 'Maximum 20 Questions in a section', 'Timer on Exam']}
                    />
                })
            }
        </div>
      </div>
  );
}

export default Plans;
